vector<int> distanceK(TreeNode* root, TreeNode* target, int k) {
    
        vector<int> res;
        unordered_map<int, vector<int>> adj;
        
        bfs(root, adj);
        int src = target->val;
        
        vector<int> dist(501, 0), vis(501, 0);
        dfs(src, adj, dist, vis);
        
        for(int i=0; i<=500; i++) {
            if(dist[i] == k && vis[i] == 1)                  res.push_back(i);
        }
        
        return res;
    }

