void dfs(int src, unordered_map<int, vector<int>> &adj, vector<int> &dist, vector<int> &vis) {
        
        vis[src] = 1;
        
        for(auto &ch : adj[src]) {
            
            if(vis[ch] == 0) {

                dist[ch] = dist[src] + 1;
                dfs(ch, adj, dist, vis);
            }
        }
        
        return;
    }

