        vector<int> dist(501, 0), vis(501, 0);
        dfs(src, adj, dist, vis);
        
        for(int i=0; i<=500; i++) {
            if(dist[i] == k && vis[i] == 1)                  res.push_back(i);
        }
        
        return res;
    }

